import React, {useEffect, useState} from 'react'
import Link from "next/link"
import Container from "../../components/container"
import BreadCrumb from "../../components/breadcrumb"
import ServiceListItem from "../../components/services-list-item"
import Config from "../../config"
import $ from "jquery"


const ServicioDetail = (props) => {     


    return (
        <Container namePage="servicios margins-body-type-2" titlePage="Servicios"> 

            <BreadCrumb />
            
                    
            

        </Container>
    )
}


ServicioDetail.getInitialProps = async (ctx) => {    
    return {currentUrl: ctx.query.name}
}



export default ServicioDetail
